How to make a chained aggregation of a mongoDB collections with multiple local-field comparisons?<p>Here are my collections:</p>

<p>users:</p>

<pre><code>{
    user: xxx,
    job: xxx,
    order: xxxx
}
</code></pre>

<p>cars:</p>

<pre><code>{
    order: xxxx,
    cost: yyyy
}
</code></pre>

<p>plane:</p>

<pre><code>{
    order: xxxx,
    cost: yyyy
}
</code></pre>

<p>insurance:</p>

<pre><code>{
    cost: yyyy,
    terms: zzzz
}
</code></pre>

<p>First, I want to join "users" with either of "cars" or "planes" based on matching the value of "order" field. Afterward, I join the result with the "insurance" collection based on the "cost" field. </p>

<p>So, I want the result to like this:</p>

<pre><code>{ "user" : xx, ..., "order": dsad, "cars": {}, "plane": {"order": ddsa, "cost": awew} , "terms": sdada},
{ "user" : yy, ..., "order": sawe, "cars": {"order": fda, "cost": qwez}, "plane": {} , "terms": tyrw},
{ "user" : zz, ..., "order": qwez, "cars": {}, "plane": {} , "terms":{} }
</code></pre>

<p>I tried using db.users.aggregate() along with $lookup as below:</p>

<pre><code>db.check.aggregate([
{
    $lookup:
        {
            from: "cars",
            localField: "order",
            foreignField: "order",
            as: "cars"
        }    
},
{
    $unwind: {path: "$cars", preserveNullAndEmptyArrays: true}
},    
{
    $lookup:
        {
            from: "planes",
            localField: "order",
            foreignField: "order",
            as: "planes"
        }    
},
{
    $unwind: {path: "$planes", preserveNullAndEmptyArrays: true}
},  
</code></pre>

<p>and it results in:</p>

<pre><code>{ "user" : xx, ..., "order": dsad, "cars": {}, "plane": {"order": ddsa, "cost": awew}},
{ "user" : yy, ..., "order": sawe, "cars": {"order": fda, "cost": qwez}, "plane": {}},
{ "user" : zz, ..., "order": qwez, "cars": {}, "plane": {}}
</code></pre>

<p>but, I do not know to go further from there!</p>

answer:
try this  ````acc.Subscriptions.SelectMany(x=>x.AddOns)
			.GroupBy(a=> a.Variations.FirstOrDefault().Code)
			.GroupBy(g=> new {code=g.Key , count= g.Count()},g=> g.ToList())````; in your fiddle.

