Top documents per bucket<p>I would like to get the documents with the N highest <code>field</code>s for each of  N categories. For example, the posts with the 3 highest <code>score</code>s from each of the past 3 months. So each month would have 3 posts that "won" for that month.</p>

<hr>

<p>Here is what my work so far has gotten, simplified.</p>

<pre><code>// simplified
db.posts.aggregate([
  {$bucket: {
      groupBy: "$createdAt",
      boundaries: [
        ISODate('2019-06-01'),
        ISODate('2019-07-01'),
        ISODate('2019-08-01')
      ],
      default: "Other",
      output: {
        posts: {
          $push: {
            // ===
            // This gets all the posts, bucketed by month
            score: '$score',
            title: '$title'
            // ===
          }
        }
      }
    }},
  {$match: {_id: {$ne: "Other"}}}
])
</code></pre>

<p>I attempted to use the $slice operator in between the <code>// ===</code>s, but go an error (below).</p>

<pre><code>  postResults: {
    $each: [{
      score: '$score',
      title: '$title'
    }],
    $sort: {score: -1},
    $slice: 2
  }
</code></pre>

<pre><code>An object representing an expression must have exactly one field: { $each: [ { score: \"$score\", title: \"$title\" } ], $sort: { baseScore: -1.0 }, $slice: 2.0 }
</code></pre>

